var t=0;
var xl=width()/6;
var xb=16;
var b=width()/2;
function hline(x1,x2,y,c1,c2){
  x1 = flr(x1);
  x2 = flr(x2);
  for(var i=x1;i<x2;i++){
    pset(i,y,(i%2)?c1:c2);
  }
}

function _init(){
  cls();
}
function _update60(){
  t++;
}

function _draw(){
  rectfill(b-xl-xb,0,b+xl+xb,height(),0);
  for(var y=0; y<height(); y++){
    var a = cos((t/300 + y/2000));
    var x1 = b + xl*sin(a);
    var x2 = b + xl*sin(a+0.25);
    var x3 = b + xl*sin(a+0.50);
    var x4 = b + xl*sin(a+0.75);

    var xm = xb*cos((t/80)-y+20*sin(t/20000+a/(120+20*sin(t/100+y/500))));

    if(x1 < x2) hline(xm+x1, xm+x2,y,8,5);
    if(x2 < x3) hline(xm+x2, xm+x3,y,9,6);
    if(x3 < x4) hline(xm+x3, xm+x4,y,11,7);
    if(x4 < x1) hline(xm+x4, xm+x1,y,10,8);
  }
}
